(() => {
  // Adjust if your SSN server runs on a different port/host:
  const SSN_HOST = 'http://127.0.0.1:3030';

  // Helper to POST to SSN's clearOverlay endpoint
  function clearOverlay(messageId) {
    fetch(`${SSN_HOST}/clearOverlay`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ messageId })
    }).catch(console.error);
  }

  // Wait until chat container is available
  function initObserver() {
    const container = document.querySelector('.chat-scrollable');
    if (!container) return setTimeout(initObserver, 500);

    const observer = new MutationObserver(mutations => {
      for (const m of mutations) {
        for (const node of m.removedNodes) {
          if (node.nodeType === 1 && node.matches('.chat-line')) {
            // Twitch uses data-a-user-id or data-id on each .chat-line
            const msgId = node.getAttribute('data-id') || node.getAttribute('data-a-user-id');
            if (msgId) clearOverlay(msgId);
          }
        }
      }
    });

    observer.observe(container, { childList: true });
    console.log('SSN delete-sync observer started');
  }

  initObserver();
})();

